import React from 'react';
import { Menu } from 'antd';
import { GithubOutlined, LinkedinFilled } from '@ant-design/icons';
import "./header.css";
import { IconContext } from "react-icons";

const labels = ['Home', 'About Me', 'Skills', 'Projects', 'Blog', 'Contact'];
const items = labels.map((label, index) => ({
  key: index + 1,
  label: `${label}`,
}));

const AppHeader = () => {
  return (
    <div className='container-fluid'>
      <div className='header'>
        <div className='logo'/>
        <Menu 
          mode='horizontal' 
          defaultSelectedKeys={['1']}
          style={{
            display: 'flex',
            justifyContent: 'flex-end',
            flex:1,
            minWidth: 0,
          }}
        >
          {items.map(item => (
            <Menu.Item key={item.key}>{item.label}</Menu.Item>
          ))}
        </Menu>
        <div className="icon-container">

          <a href="https://www.linkedin.com/in/your-linkedin-profile" target="_blank" rel="noopener noreferrer" className="linkedin">
            <LinkedinFilled style={{fontSize:'18px',color:'#fff'}}/>
          </a>

        </div>
      </div>
    </div>
  );
}

export default AppHeader;
